import React, { Component } from "react";
import { StyleSheet, View, Text, Image } from "react-native";
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import { createTheme, ThemeProvider } from '@mui/material/styles';

function Copyright(props) {
    return (
      <Typography variant="body2" color="text.secondary" align="center" {...props}>
        {'Copyright © '}
        <Link color="inherit" href="https://mui.com/">
          AlbalatEat
        </Link>{' '}
        {new Date().getFullYear()}
        {'.'}
      </Typography>
    );
  }


function Home(props) {
  return (
    <View style={styles.container}>
      <Text style={styles.loremIpsum}></Text>
      <Text style={styles.loremIpsum2}></Text>
      <Text style={styles.albalateat}>ALBALATEAT</Text>
      <Image
        source={require("../media/albalat_logo.png")}
        resizeMode="contain"
        style={styles.image}
      ></Image>
      <Grid container component="main" sx={{ height: '100vh' }}>
        <CssBaseline />
        <Grid
          item
          xs={false}
          sm={4}
          md={7}
          sx={{
            backgroundImage: 'url(https://www.consejocolegiosmayores.es/wp-content/uploads/2016/12/Albalat1-1.jpg)',
            backgroundRepeat: 'no-repeat',
            backgroundColor: (t) =>
              t.palette.mode === 'light' ? t.palette.grey[50] : t.palette.grey[900],
            backgroundSize: 'cover',
            backgroundPosition: 'center',
          }}
        />
        <Grid item xs={12} sm={8} md={5} component={Paper} elevation={6} square>
          <Box
            sx={{
              my: 8,
              mx: 4,
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
            }}
          >
            <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
              <img src='https://pbs.twimg.com/profile_images/1111386984793235456/FWN34cH0_400x400.jpg' height='42px' width='42px'></img>
            </Avatar>
            <Typography component="h1" variant="h5">
              AlbalatEat
            </Typography>
            <Box component="form" noValidate onSubmit={''} sx={{ mt: 1 }}>
              <TextField
                margin="normal"
                required
                fullWidth
                id="username"
                label="Nombre de Usuario"
                name="text"
                value={''}
                autoComplete="email"
                autoFocus
                
              />
              <TextField
                margin="normal"
                required
                fullWidth
                name="password"
                value={''}
                label="Contraseña"
                type="password"
                id="password"
                autoComplete="current-password"
                
              />
              <Button
                type="submit"
                fullWidth
                variant="contained"
                sx={{ mt: 3, mb: 2 }}
              >
                Iniciar Sesión
              </Button>
              <Grid container>
                <Grid item xs>
                  <Link href="#" variant="body2">
                    ¿Te has olvidado de la contraseña?
                  </Link>
                </Grid>
                <Grid item>
                  <Link href="#" variant="body2">
                    {"¿Aún no tienes cuenta? Regístrate"}
                  </Link>
                </Grid>
              </Grid>
              <Copyright sx={{ mt: 5 }} />
            </Box>
          </Box>
        </Grid>
      </Grid>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "rgba(45,47,158,1)"
  },
  loremIpsum: {
    fontFamily: "roboto-regular",
    color: "#121212",
    marginTop: 92,
    marginLeft: 82
  },
  loremIpsum2: {
    fontFamily: "roboto-regular",
    color: "#121212",
    height: 5,
    width: 1,
    transform: [
      {
        rotate: "90.00deg"
      }
    ],
    marginTop: 20,
    marginLeft: 93
  },
  albalateat: {
    fontFamily: "roboto-700",
    color: "rgba(255,255,255,1)",
    fontSize: 28,
    marginTop: 241,
    marginLeft: 102
  },
  image: {
    width: 200,
    height: 200,
    marginTop: -252,
    alignSelf: "center"
  }
});

export default Home;
